import React from 'react'

const Star = (props) => {
    let stars = [];
    for (let i = 0; i < props.rating; i++)
        stars.push('&#9733');
    for (let i = 5; i < props.rating; i--)
        stars.push('&#9734');
    return(
        stars
    )
}

export default Star;
